import React from 'react';

const skills = [
  { name: 'React', pct: 90 },
  { name: 'JavaScript', pct: 95 },
  { name: 'Tailwind', pct: 88 },
  { name: 'Node.js', pct: 80 },
];

export default function Skills() {
  return (
    <section className="container mx-auto px-6 py-10">
      <div className="max-w-2xl mx-auto">
        <h3 className="text-xl font-semibold mb-6">My Skills</h3>
        <div className="space-y-5">
          {skills.map((s) => (
            <div key={s.name}>
              <div className="flex justify-between text-sm mb-1">
                <span>{s.name}</span>
                <span className="text-muted">{s.pct}%</span>
              </div>
              <div className="w-full h-3 bg-zinc-800 rounded overflow-hidden">
                <div className="h-full progress-bg" style={{ width: `${s.pct}%` }} />
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
